import React from 'react'

export default function Navbar() {
  return (
    <nav>
      <ul>
        <li><a><h1>Ifa Brand</h1></a></li>
        <li><a>Work</a></li>
        <li><a>About</a></li>
        <li><a>Shop</a></li>
      </ul>
      <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
          vertical-align: center;
        }

        ul {
          display: flex;
          padding: 0;
        }

        li {
          display:flex;
          list-style: none;
        }

        h1 {
          font-size: 30px;
          margin: 0;
          margin-right: 60px;
        }

        a {
          cursor: pointer;
          text-decoration: none;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </nav>
  )
}
